import Shelf from "./BookShelf";
// import ShelfCurrentlyReading from "./BookShelf";
// import ShelfRead from "./ShelfRead";
// import ShelfWantToRead from "./ShelfWantToRead";


const ListBooksContant  = ({ currentlyReading , wantToRead, read }) => {
    return (
       <div className="list-books-content">
            {/* <ShelfCurrentlyReading currentlyReading={currentlyReading}/>
            <ShelfWantToRead/>
            <ShelfRead/> */}
            <Shelf title ="Currently Reading" books = {currentlyReading} />
            <Shelf title ="Read" books ={read} />
            <Shelf title ="Want to read" books = {wantToRead} />            
        </div>
     
     );
}
 
export default ListBooksContant ;
